import React, { useState } from 'react';

function Square(props) {
  const [clicked, setClicked] = useState(false);

  function squareClick() {
    setClicked(true);
  }

  return (
    <button className="square" onClick={squareClick}>

      {clicked.toString()}
    </button>
  );
}

export default Square;
